git clone big-repo big-repo-clone
(cd big-repo-clone
  $CLI project add --switch-to-workspace "$(git rev-parse --symbolic-full-name @{u})"
  $CLI branch create no-change
)

function change-all() {
  local content="${1:?first argument is the content to write to all tracked files}"

  new_oid=$(echo -n $content | git hash-object -w --stdin)
  git ls-files | while read -r p; do echo 100644 $new_oid$'\t'$p; done | git update-index --index-info
  git commit -m "change with $content" && git checkout HEAD
}

git clone big-repo big-repo-clone-one-commit-ahead
(cd big-repo-clone-one-commit-ahead
  $CLI project add --switch-to-workspace "$(git rev-parse --symbolic-full-name @{u})"
  $CLI branch create virtual

  change-all new-content
  $CLI branch create trigger-auto-branch-creation
)

git init remote
(cd remote
  echo first > file
  git add . && git commit -m "init"
)

git clone remote revwalk-repo
(cd revwalk-repo
  for round in $(seq 5); do
    echo main >> file
    git commit -am "main-$round"
  done

  local_tracking_ref="$(git rev-parse --symbolic-full-name @{u})";

  git checkout -b feature main
  for round in $(seq 100); do
    echo feature >> file
    git commit -am "feat-$round"
  done

  git checkout main
  $CLI project add --switch-to-workspace "$local_tracking_ref"
  for round in $(seq 10); do
    echo virtual-main >> file
    $CLI branch commit --message "virt-$round" main
  done

  git checkout -b non-virtual-feature main
  for round in $(seq 50); do
    echo non-virtual-feature >> file
    git commit -am "non-virtual-feat-$round"
  done

  # pretend the remote is at the same state as our local `main`
  git update-ref refs/remotes/origin/main main
  git gc --aggressive
)
